  navigator.clipboard.writeText('bryandhmin@gmail.com');
  const bar = document.getElementById('bar');
  const copiedButton = document.createElement('div');
  copiedButton.innerHTML = "Copied email to clipboard!";
  bar.appendChild(copiedButton);
}

export default NavBar
